import React from "react";
import "../styles.css";

const Footer = () => {
  return (
    <footer className="footer">
      <p>Author: Vaibhav Chauhan</p>
      <a href="mailto:chauhanvaibhav758@gmail.com">vaib@gmail.com</a>
    </footer>
  );
};

export default Footer;
